def Ind2complexes(lst, type_of_l):
    f = open("make_seq/structure_seq/input_seq_" + type_of_l + ".csv", "r")
    r = csv.reader(f)

    seq_lst = []
    for l in r:
        for e in l:
            seq_lst.append(e)
    
    for i, e in enumerate(lst):
        if e == 1:
            print(seq_lst[i])

